commit.message:
Refactored ShardedSessionImpl:
- Replaced IOpenSessionEvent implementations with delegates;
- Implemented support for entity names;
- Implemented support for EntityModes;
- Integrated code for detection of cross-shard relationships from CrossShardRelationshipDetectingInterceptor;
Ported tests for sharded transactions and rewrote ShardedTransactionImpl to ensure consistency with regular NHibernate transaction behaviour.
Infinite recursion bug fix in ShardedTableHiLoGenerator.
